import React from 'react';

import './Footer.css';

class Footer extends React.Component {

    render() {
        return (
            <div className="footer">
                    <img src="/vector.png" alt="logo" className="cs-logo"></img>
                    <div className="footerTextBox">
                        <p></p>
                        <p></p>
                        <p></p>
                    </div>
            </div>
        )
    }
}

export default Footer;
